import React, { useState, useEffect } from "react";

function Students() {
  const [students, setStudents] = useState([]);
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [studentId, setStudentId] = useState("");
  const [pincode, setPincode] = useState("");
  const [district, setDistrict] = useState("");
  const [state, setState] = useState("");
  const [country, setCountry] = useState("");

  useEffect(() => {
    fetch("http://127.0.0.1:8000/api/students/")
      .then((res) => res.json())
      .then((data) => setStudents(data));
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();
    fetch("http://127.0.0.1:8000/api/students/", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({
        name,
        email,
        studentId,
        pincode,
        district,
        state,
        country,
      }),
    })
      .then((res) => {
        if (!res.ok) {
          throw new Error("Failed to add student");
        }
        return res.json();
      })
      .then((data) => {
        setStudents([...students, data]);
        setName("");
        setEmail("");
        setStudentId("");
        setPincode("");
        setDistrict("");
        setState("");
        setCountry("");
      })
      .catch((err) => console.error(err));
  };

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold text-red-700 mb-6">Student Management</h2>

      {/* Add Student Form */}
      <form
        onSubmit={handleSubmit}
        className="bg-white p-6 rounded-lg shadow-md mb-6"
      >
        <h3 className="text-lg font-semibold mb-4 text-gray-700">Add Student</h3>

        <div className="grid grid-cols-2 gap-4">
          <input
            type="text"
            placeholder="Name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            className="border p-2 rounded"
            required
          />
          <input
            type="email"
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            className="border p-2 rounded"
            required
          />
          <input
            type="text"
            placeholder="Student ID"
            value={studentId}
            onChange={(e) => setStudentId(e.target.value)}
            className="border p-2 rounded"
            required
          />
          <input
            type="text"
            placeholder="Pincode"
            value={pincode}
            onChange={(e) => setPincode(e.target.value)}
            className="border p-2 rounded"
          />
          <input
            type="text"
            placeholder="District"
            value={district}
            onChange={(e) => setDistrict(e.target.value)}
            className="border p-2 rounded"
          />
          <input
            type="text"
            placeholder="State"
            value={state}
            onChange={(e) => setState(e.target.value)}
            className="border p-2 rounded"
          />
          <input
            type="text"
            placeholder="Country"
            value={country}
            onChange={(e) => setCountry(e.target.value)}
            className="border p-2 rounded"
          />
        </div>

        <button
          type="submit"
          className="mt-4 bg-red-600 text-white px-4 py-2 rounded hover:bg-red-700"
        >
          Add Student
        </button>
      </form>

      {/* Student Table */}
      <table className="min-w-full bg-white rounded-lg shadow-md">
        <thead>
          <tr className="bg-red-600 text-white text-left">
            <th className="py-2 px-4">Name</th>
            <th className="py-2 px-4">Email</th>
            <th className="py-2 px-4">Student ID</th>
            <th className="py-2 px-4">Pincode</th>
            <th className="py-2 px-4">District</th>
            <th className="py-2 px-4">State</th>
            <th className="py-2 px-4">Country</th>
          </tr>
        </thead>
        <tbody>
          {students.map((s) => (
            <tr key={s.id} className="border-b">
              <td className="py-2 px-4">{s.name}</td>
              <td className="py-2 px-4">{s.email}</td>
              <td className="py-2 px-4">{s.studentId}</td>
              <td className="py-2 px-4">{s.pincode}</td>
              <td className="py-2 px-4">{s.district}</td>
              <td className="py-2 px-4">{s.state}</td>
              <td className="py-2 px-4">{s.country}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Students;
